@Slyfoxy
First off you can't change a file to a "DvDRip", DvDRips are ripped directly from DVDs, hence better quality. This is a cam, so not as good of quality, (but it's as much as we can expect right now seeing as this is still in theatres), but you can still put it on a DVD if you want. I personally would wait for the DVD/Blu-Ray Rips to come out before I burned it to a DVD though. If you want to burn it to a DVD I'd recommend ConvertXtoDVD http://thepiratebay.org/torrent/6039993/ConvertXtoDVD_v4.1.9.347___Serials_[ChattChitto_RG]

Try and do your research beforehand, it'll save you a lot of trouble down the road.
